import React from "react";

const Movies = (props) => {
  const { data } = props;

  return (
    <>
      <ul>
        {/* <p>{count}</p> */}
        {data.map((movie) => {
          return (
            <li className="movie" key={movie.id}>
              {movie.title}
            </li>
          );
        })}
      </ul>
    </>
  );
};

export default Movies;
